import React from 'react'

function NoteInfo({noteInfo}) {
  return (
    <div className='w-[25%] min-h-48 h-max float-left m-1 bg-slate-300 rounded-lg p-2'>
      {noteInfo.Text}
    </div>
  )
}

export default NoteInfo
